import React from 'react'
import { Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';
import Crypto from './Crypto';
import App from './App';

const Brow = () => {
  return (
    <div>
        <Routes>
            <Route path="/" element={<App/>}></Route>
            <Route path="/crypto" element={<Crypto/>}></Route>
      </Routes>
    </div>
  )
}

export default Brow
